import { upload } from './services/upload';
import { stringToNumberOrRandom } from './services/numbers';
import * as admin from 'firebase-admin'
import * as automl from '@google-cloud/automl';
import * as vision from '@google-cloud/vision';
import * as storage from '@google-cloud/storage'
import * as requestLib from 'request';
import * as fs from 'fs'
const client = new storage.Storage();
const adminConfig = JSON.parse(process.env.FIREBASE_CONFIG);
if (fs.existsSync('./.secret/.mooie-man-9dcf8a229f3f.json')) {
    const serviceAccount = require('./.secret/.mooie-man-9dcf8a229f3f');
    adminConfig.credential = admin.credential.cert(serviceAccount);
}
admin.initializeApp(adminConfig);
const db = admin.firestore();
const server = gqlServer();
const dev = Boolean(process.env.FUNCTIONS_EMULATOR);
const STATUS_CODES = { '404': 'NotFound', '500': 'InternalServerError' }
interface HTTPErrorConstructor {
    new(code: number, message?: string);
}
interface HTTPErrorInterface extends Error {
    statusCode: number
}
const HTTPError: HTTPErrorConstructor = class HTTPError extends Error implements HTTPErrorInterface {
    statusCode
    constructor(code, message) {
        super(message || STATUS_CODES[code]);
        this.name = String(STATUS_CODES[code]);
        this.statusCode = code;
    }
}

const getUrl = (defaultBucket) => async (type, id) => {
    const prefix = `${type}${id.padStart(4, '0')}`
    const [files] = await defaultBucket.getFiles({ maxResusult: 1, prefix: prefix })
    if (files.length === 0) throw (new HTTPError(404, `${type} image not found`))
    return "https://firebasestorage.googleapis.com/v0/b/mooie-man.appspot.com/o/" + files[0].name + "?alt=media"
}
const defaultBucket = admin.storage().bucket();
const getUrlByTypeAndId = getUrl(defaultBucket)
const handleGetRequest = (type) => async (response, request) => {
    try {
        const max = await db.collection('stats').doc(type).get().then(v => v.data().count);
        const id = String(stringToNumberOrRandom(request.params, max)); // whatever params are given, try to get the number out of it
        const url = await getUrlByTypeAndId(type, id);
        requestLib.head(url, (err, res) => {
            if (err) throw (new HTTPError(404, `${type} not found`))
            response.setHeader('Content-Type', res.headers['content-type']);
            requestLib(url).pipe(response); // pipe the download response
        });
    } catch (e) {
        console.log(e)
        response.status(500).json(e)
    }
    return response.send()
}
const handleMooiemanRequest = handleGetRequest('mooieman')
const handleFraaievrouwRequest = handleGetRequest('fraaievrouw')

// Graphql api
// https://us-central1-mooie-man.cloudfunctions.net/graphql/
const graphql = https.onRequest(server);
const count = https.onRequest(handleCountRequest)
const mooieman = https.onRequest(handleMooiemanRequest)
const fraaievrouw = https.onRequest(handleFraaievrouwRequest)
export { graphql, count, mooieman, fraaievrouw };
